import './App.css';
import { BrowserRouter,Switch,Route } from "react"
import Store from './pages/Store'
import Product from "./pages/Product"

function App() {
  return (
  <BrowserRouter>
    <Switch>
      <Route exact path="/" component={Store} />
      <Route path="/product/:productId" component={Product} />
    </Switch>
  </BrowserRouter>
  );
}

export default App;
